import React from 'react';
import './css/hotel.css';
import {VoteComponent} from './ratedServices/ratedServices';
export const HotelComponent = ({hotels=[]})=>{
    return (
        <div className='hotels'>
                {hotels.map((hotel)=>{
                    return(
                        <div key={hotel.id} className='hotel'>
                            <p>{hotel.name}</p>
                            <VoteComponent services={hotel.services}/>
                            <div className=''>

                            </div>
                        </div>
                    )

                })}
        </div>
    )
}
